use crate::numerics::float::Float;
use crate::physics::consts::{ALPHA, HARTREE};
use crate::physics::materials::electronic::ElectronicShell;


//================================================================================================
// Electronic shell data for Z=1-99, from PENELOPE (pdatconf.p14).
//================================================================================================

pub struct ShellData (pub u8, pub u8, pub f32, pub f32);

impl From<&ShellData> for ElectronicShell {
    fn from(value: &ShellData) -> Self {
        const MEV: Float = 1e-6; // eV to MeV.
        const AU: Float = HARTREE / ALPHA; // atomic unit, in MeV.
        Self {
            occupancy: value.1 as Float,
            energy: (value.2 as Float) * MEV,
            momentum: AU / (value.3 as Float),
        }
    }
}

